import Nav from "../src/components/Nav";
import Main from "../src/components/Main";
import {
  faYelp,
  faInstagram,
  faFacebook
} from '@fortawesome/free-brands-svg-icons';

library.add(
  faYelp,
  faInstagram,
  faFacebook
);

const Index = () => {
  return (
      <div>
          <Nav/>
          <Main/>
      </div>
  );
};

export default Index;
